import React, { Component } from 'react';
import 'bootstrap/dist/css/bootstrap.css';
import { Navbar } from 'react-bootstrap';
import './Nav_Bar.css';

const Nav_Bar = () => {
  return (
    <div>
      <Navbar bg="my-Blue" variant="dark">
        <Navbar.Brand href="">
          <img alt="" src="src/Images/Icons/favicon-32x32.svg" width="30" height="30" className="d-inline-block align-top" /> Present Simple
        </Navbar.Brand>
      </Navbar>
    </div>
  );
};

export default Nav_Bar;
